import React,{useEffect} from 'react'
import { Redirect } from 'react-router-dom';

const EditJobs = ({ isAuthenticated }) => {
    useEffect(() => {
        if (!isAuthenticated) {
            <Redirect
                to={{
                    pathname: "/signin",
                }}
            />;
        }
    }, [isAuthenticated]);
    return <div>You are autheticated and able to edit the jobs</div>;

}

export default EditJobs
